啊啊啊 好久没发游玩笔记了[笑哭R]
这次趁着5.1假期和老妈一起出来打卡～[哇R]
✨魔都Teamlab大家都知道很火爆，人也是非常非常多的，因为不想假期人挤人，所以搜了个更为精致小众的mini teamlab去打卡。[害羞R]
✨展馆坐落在商场里，有点隐蔽，外面不是很好找，但是里面满满都是料，每个空间虽然不大，但是灯光效果非常棒！很好拍！重点是人少！！！真的是随便拍，随便玩！[赞R]
✨ps：玩儿完了还可以在日月光广场吃饭，周边美食太多了… 吃完饭，对面是田子坊，顺便一起逛逛吧[自拍R]
🕓开放时间：10:00——22:00
📍详细地点：打浦桥日月光5F（田子坊旁）
🎫展馆票价：49 RMB
👗建议穿搭：干净简洁，浅色系衣服。
